//输入灰度图像，返回数组  
vector<vector<int>> Mat2Array(Mat image)
{
	//得宽高
	int w = image.cols * 3;
	int h = image.rows;
	int channel = image.channels();
	std::cout << channel << std::endl;
	vector<vector<int>>image_arr;
	image_arr.resize(h);
	//得到初始位置的迭代器 
	Mat_<uchar>::iterator it = image.begin<uchar>();
	//得到终止位置的迭代器 
	Mat_<uchar>::iterator itend = image.end<uchar>();

	for (size_t i = 0; i < h; i++)
	{
		for (size_t j = 0; j < w; j++)
		{
			int pixel = *(it + i * w + j);
			image_arr[i].push_back(pixel);
		}
	}
	resize(image, image, Size(800, 600));//缩放
	imshow("截取到的图像", image);
	cv::waitKey(0);
	return image_arr;
}


//输入数组，返回灰度图像
Mat Array2Mat(vector<vector<int>> image_arr)
{
	Mat M(600, 800, CV_8UC1);
	if (image_arr.size()>0)
	{
		if (image_arr[0].size()>0)
		{
			resize(M, M, Size(image_arr[0].size(), image_arr.size()));//缩放:列行

			for (int i = 0; i < M.rows; i++)
			{
				uchar *p = M.ptr<uchar>(i);
				for (int j = 0; j < M.cols; j++)
				{
					if (j == M.cols - 3)
					{
						j = M.cols - 3;
					}
					p[j] = image_arr[i][j];
				}
			}

		}
	}

	resize(M, M, Size(800, 600));//缩放
	imshow("数组生成的图像", M);
	cv::waitKey(0);
	return M;

}


//传入图片地址，输出二维vector
vector<vector<uchar> > decode(char* path)   //path为图片路径
{
	Mat img = imread(path);                // 将图片传入Mat容器中
	//       显示原图片
	//       namedWindow("old", WINDOW_NORMAL);
	//       imshow("old", img);
	//      waitKey(0);
	int w = img.cols * img.channels();     //可能为3通道，宽度要乘图片的通道数
	int h = img.rows;

	vector<vector<uchar> > array(h, vector<uchar>(w));      //初始化二维vector
	for (int i = 0; i < h; i++)
	{
		uchar* inData = img.ptr<uchar>(i);            //ptr为指向图片的行指针，参数i为行数
		for (int j = 0; j < w; j++)
		{
			array[i][j] = inData[j];
			//std::cout << std::to_string(array[i][j]) << ",";
		}
		//std::cout << " " << std::endl;
	}
	return array;
}


//传入二维vecotr，显示输出的图片，并保存图片到指定地址
Mat code(vector<vector<uchar> > array)
{
	size_t h = array.size();
	size_t w = array[0].size();
	//初始化图片的像素长宽
	Mat img(h, (size_t)(w / 3), CV_8UC3);           //保存为RGB，图像列数像素要除以3；
	for (size_t i = 0; i < h; i++)
	{
		uchar* outData = img.ptr<uchar>(i);
		for (size_t j = 0; j < w; j++)
		{
			outData[j] = array[i][j];
		}
	}
	namedWindow("new", WINDOW_NORMAL);
	imshow("new", img);
	waitKey(0);
	//imwrite("目标地址\\save.jpg", img);
	return img;
}


//将二维vector写入文件或输出
void vector2file(std::vector<std::vector<uchar>> img_array) {
	ofstream img_array_file("img_array.txt", ios::trunc);

	for (int i = 0; i < img_array.size(); ++i) {
		img_array_file << "{";
		for (int j = 0; j < img_array[0].size(); ++j) {
			img_array_file << std::to_string(img_array[i][j]) << ",";
		}
		img_array_file << "},";
	}
}


void changeRGB(Mat img)
{
	
	int maxDif = 40;
	int  R = 28, G = 63, B = 138;
	for (int row = 0; row < img.rows; row++)
	{
		for (int col = 0; col < img.cols; col++)
		{
			if (abs(img.at<Vec3b>(row, col)[0] - B) < maxDif && abs(img.at<Vec3b>(row, col)[1] - G) < maxDif && abs(img.at<Vec3b>(row, col)[2] - R) < maxDif)
			{
				img.at<Vec3b>(row, col)[0] = 255;
				img.at<Vec3b>(row, col)[1] = 255;
				img.at<Vec3b>(row, col)[2] = 255;
			}
			else {
				img.at<Vec3b>(row, col)[0] = 0;
				img.at<Vec3b>(row, col)[1] = 0;
				img.at<Vec3b>(row, col)[2] = 0;
			}
		}
	}
	imshow("changeRGB", img);
}

Mat my_dilate(Mat img) {
	Mat dilated_my;
	dilated_my.create(img.rows, img.cols, CV_8UC1);
	for (int i = 0; i < img.rows; ++i)
	{
		for (int j = 0; j < img.cols; ++j)
		{
			//uchar minV = 255;
			uchar maxV = 0;

			//遍历周围最大像素值
			for (int yi = i - 1; yi <= i + 1; yi++)
			{
				for (int xi = j - 1; xi <= j + 1; xi++)
				{
					if (xi<0 || xi >= img.cols || yi<0 || yi >= img.rows)
					{
						continue;
					}
					//minV = (std::min<uchar>)(minV, img.at<uchar>(yi, xi));
					maxV = (std::max<uchar>)(maxV, img.at<uchar>(yi, xi));
				}
			}
			dilated_my.at<uchar>(i, j) = maxV  ;
		}
	}
	return dilated_my;
}

void Contours(Mat img)  //轮廓
{
	resize(img, img, Size(600, 512));
	imshow("原图", img);
	//备份原始图像，用来显示查找的轮廓
	Mat dst = img.clone();

	//高斯模糊
	GaussianBlur(dst, dst, Size(3, 3),0, 0, BORDER_DEFAULT);
	imshow("高斯模糊", dst);

	changeRGB(dst);

	Mat dst1;

	//彩色图像转换为灰度图像
	cvtColor(dst, dst1, CV_BGR2GRAY);
	
	//对图像进行二值化处理
	//threshold(dst1, dst1, 128, 255, THRESH_BINARY);

	//imshow("二值化后", dst1);

	//canny边缘检测
	Canny(dst1, dst1, 125, 350);
	imshow("canny", dst1);

	//膨胀腐蚀
	dst1 = my_dilate(dst1);
	//dilate(dst1, dst1, Mat());
	//erode(dst1, dst1, Mat());
	imshow("膨胀腐蚀", dst1);

	

	vector<vector<Point>> contours;
	vector<Vec4i> hierarchy;

	//查找图像轮廓 查找的轮廓为白色区域的轮廓
	findContours(dst1, contours, hierarchy, RETR_EXTERNAL, CHAIN_APPROX_SIMPLE);

	//定义外接矩形
	vector<Rect> boundRect(contours.size());
	double length, area, rectArea;
	double rectDegree = 0.0; //矩形度
	double long2Short = 1.0; //体态比
	int temp,width,height;
	

	for (int i = 0; i < contours.size(); i++)
	{
		area = contourArea(contours[i]);

		if (area > 1000.0 && area < 50000.0)
		{
			//获取最小外接矩形
			boundRect[i] = boundingRect(contours[i]);

			rectDegree = area / boundRect[i].area();  //矩形度（适用于有旋转角度的最小外接矩形）
			width = boundRect[i].width;
			height = boundRect[i].height;
			if (width > height)
			{
				temp = width;
				width = height;
				height = temp;
			}

			long2Short = height / width;
		
			if (boundRect[i].width > 10 && boundRect[i].width < 300 && boundRect[i].height > 10 && boundRect[i].height <700)
			//if (rectDegree > 0.63 && boundRect[i].area() < 50000 )
			{
				//在原图像上绘制最小外接矩形
				rectangle(dst, boundRect[i], Scalar(0, 255, 0));
				rectangle(img, boundRect[i], Scalar(0, 255, 0));
			}

		}
		
	}
	imshow("效果图1", dst);
	imshow("效果图2", img);
}